import React from 'react';
import Fire from '../Config/Fire'
import Register from '../Components/Register'
import '../Config/myStyle.css'

class Home extends React.Component{

    logout(){
        Fire.auth().signOut();
    }

  render() {
    return(
      <div>
        <h1>
            Welcome to zForum!
            <button onClick={this.logout} className="btn btn-light fright btnalign">Logout</button>
        </h1>
      </div>
    )
  }
}

export default Home;
